
public class Casting {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		byte a =10;
		byte b = 20;
		int c = (int) (a*b);
		System.out.println(c);
		
		final int size = 100;
		for(int i=0;i<size;i++)
		{
			System.out.print(i+" ");
		}
		

	}

}
